/*Write a C program to declare two integers and one float variables then initialize them to 10, 15, and 12.6. It then prints these values on the screen.*/
#include<stdio.h>
void main()
{
    int a,b;
    float c;
    a=10;
    b=15;
    c=12.6;
    printf("A=%d B=%d C=%f",a,b,c);
}

/*Write a C++ program to declare two integers and one float variables then initialize them to 10, 15, and 12.6. It then prints these values on the screen.*/
#include<iostream>
using namespace std;
int main()
{
    int a=10,b=15;
    float c=12.6;
    cout<<"a:"<<a<<endl;
    cout<<"b:"<<b<<endl;
    cout<<"c:"<<c;
    return 0;
}

/*Write a java program to declare two integers and one float variables then initialize them to 10, 15, and 12.6. It then prints these values on the screen.*/
public class Funycode {
    public static void main(String[] args) {
            int a=10,b=15;
            double c=12.6;
            System.out.println("a="+a);
            System.out.println("b="+b);
            System.out.println("c="+c);
    }
}

